import React from 'react';
import { Tabs, Tab, TabList, TabPanel } from 'react-tabs';
import ContentWrapper from './ContentWrapper/ContentWrapper';
import Home from './TabContent/Home/Home';
import About from './TabContent/About/About';
import './Layout.css';
import Photos from './TabContent/Photos/Photos';

export default function Layout() {
  const photos = [
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
    {
      url: "https://via.placeholder.com/150",
    },
  ]
  return (
    <Tabs defaultIndex={2}>
      <TabList>
        <Tab>Home</Tab>
        <Tab>About</Tab>
        <Tab>Photos</Tab>
      </TabList>
      <TabPanel>
        <ContentWrapper>
          <Home />
        </ContentWrapper>
      </TabPanel>
      <TabPanel>
        <ContentWrapper>
          <About />
        </ContentWrapper>
      </TabPanel>
      <TabPanel>
        <ContentWrapper>
          <Photos
            photos = {photos}
          />
        </ContentWrapper>
      </TabPanel>
    </Tabs>
  )
}
